import React from 'react';
import './Footer.css'; // Import the CSS file for styling
import { Link } from 'react-router-dom';
import { FaTelegram, FaFacebook, FaTwitter, FaInstagram } from 'react-icons/fa';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <div className="row pt-16 pb-8">
          <div className="col-md-4">
            <div className="footer-links">
              <h3 className="text-base font-bold mb-2">Customer Service</h3>
              <Link to="/contact-us">Contact Us</Link>
              <Link to="/rules">Rules and Policy</Link>
              <Link to="/faq">FAQs</Link>
            </div>
          </div>
          <div className="col-md-4">
            <div>
              <h3 className="text-base font-bold mb-2">About Us</h3>
              <p className="mb-2">Our hasab provides anonymity.</p>
            </div>
          </div>
          <div className="col-md-4">
            <ul className="footer-links justify-content-end">
              <li>
                <Link to="/">
                  <FaTelegram /> Telegram
                </Link>
              </li>
              <li>
                <Link to="/about">
                  <FaFacebook /> Facebook
                </Link>
              </li>
              <li>
                <Link to="/contact">
                  <FaTwitter /> Twitter
                </Link>
              </li>
              <li>
                <Link to="/contact">
                  <FaInstagram /> Instagram
                </Link>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
